import React, { Component } from 'react';
import './Hex.scss';

class HexGrid extends Component {

    hexGrid(n) {
        let grid = []
        for(let i=0; i<n; i++){ 
            grid.push(
                <li>
                    <div class="hexagon"></div>
                </li>
            )
        }
        return grid;
    }
    render() {
        return (
            <ul id="grid" class="clear">
                {this.hexGrid(3, 4)}
            </ul>
        );
    }
} 
export default HexGrid;
